INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "キャル", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 0.0, "2015/12/17 15:00:00", 1, 7, 0, 0, 7001, 0.0, "2030/12/17 14:59:59", 106001, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "コッコロ", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 0.0, "2015/12/17 15:00:00", 1, 7, 0, 0, 7002, 0.0, "2030/12/17 14:59:59", 105901, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "ペコリーヌ", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 0.0, "2015/12/17 15:00:00", 1, 7, 0, 0, 7003, 0.0, "2030/12/17 14:59:59", 105801, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "キャル", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 0.0, "2015/12/17 15:00:00", 1, 10, 0, 0, 10001, 0.0, "2030/12/17 14:59:59", 106001, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "コッコロ", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 0.0, "2015/12/17 15:00:00", 1, 10, 0, 0, 10002, 0.0, "2030/12/17 14:59:59", 105901, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "ペコリーヌ", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 0.0, "2015/12/17 15:00:00", 1, 10, 0, 0, 10003, 0.0, "2030/12/17 14:59:59", 105801, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-416.5, "ペコリーヌ", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 0.0, "2015/12/17 15:00:00", 1, 12, 0, 0, 12001, 0.0, "2030/12/17 14:59:59", 105801, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "キャル", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 0.0, "2015/12/17 15:00:00", 1, 13, 0, 0, 13001, 0.0, "2030/12/17 14:59:59", 106001, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "コッコロ", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 0.0, "2015/12/17 15:00:00", 1, 13, 0, 0, 13002, 0.0, "2030/12/17 14:59:59", 105901, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "ペコリーヌ", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 0.0, "2015/12/17 15:00:00", 1, 13, 0, 0, 13003, 0.0, "2030/12/17 14:59:59", 105801, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "キャル", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 0.0, "2015/12/17 15:00:00", 1, 14, 0, 0, 14001, 0.0, "2030/12/17 14:59:59", 106001, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "コッコロ", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 0.0, "2015/12/17 15:00:00", 1, 14, 0, 0, 14002, 0.0, "2030/12/17 14:59:59", 105901, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "ペコリーヌ", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 0.0, "2015/12/17 15:00:00", 1, 14, 0, 0, 14003, 0.0, "2030/12/17 14:59:59", 105801, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-470.0, "コッコロ", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 0.0, "2015/12/17 15:00:00", 1, 15, 0, 0, 15001, 0.0, "2030/12/17 14:59:59", 105901, 1);
