INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, "エリコ（バレンタイン）", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, 4.08, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24001, 8.0, "2030/12/17 14:59:59", 109001, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, "エリコ（バレンタイン）", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, 5.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24002, 8.0, "2030/12/17 14:59:59", 109001, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, "エリコ（バレンタイン）", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 3, 10.11, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24003, 8.0, "2030/12/17 14:59:59", 109001, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, "エリコ（バレンタイン）", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4, 4.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24004, 8.0, "2030/12/17 14:59:59", 109001, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, "エリコ（バレンタイン）", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 5, 6.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24005, 8.0, "2030/12/17 14:59:59", 109001, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, "エリコ（バレンタイン）", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 6, 0.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24006, 0.0, "2030/12/17 14:59:59", 109002, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, "エリコ（バレンタイン）", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 7, 0.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24007, 0.0, "2030/12/17 14:59:59", 109002, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, "エリコ（バレンタイン）", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 8, 0.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24008, 0.0, "2030/12/17 14:59:59", 109002, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, "エリコ（バレンタイン）", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 9, 0.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24009, 0.0, "2030/12/17 14:59:59", 109002, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, "エリコ（バレンタイン）", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 10, 0.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24010, 0.0, "2030/12/17 14:59:59", 109002, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, "シズル（バレンタイン）", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, 2.12, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24011, 8.0, "2030/12/17 14:59:59", 109101, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, "シズル（バレンタイン）", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, 4.19, "2019/01/31 12:00:00", 5, 24, 10011, 0, 24012, 8.0, "2030/12/17 14:59:59", 109101, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, "シズル（バレンタイン）", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 3, 2.3, "2019/01/31 12:00:00", 2, 24, 10011, 0, 24013, 8.0, "2030/12/17 14:59:59", 109101, 4);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, "シズル（バレンタイン）", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 4, 0.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24014, 0.0, "2030/12/17 14:59:59", 109102, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, "シズル（バレンタイン）", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, 5.23, "2019/01/31 12:00:00", 5, 24, 10011, 0, 24015, 8.0, "2030/12/17 14:59:59", 109101, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, "シズル（バレンタイン）", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 6, 0.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24016, 0.0, "2030/12/17 14:59:59", 109102, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, "シズル（バレンタイン）", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 7, 5.01, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24017, 8.0, "2030/12/17 14:59:59", 109101, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, "シズル（バレンタイン）", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 8, 0.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24018, 0.0, "2030/12/17 14:59:59", 109102, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, "シズル（バレンタイン）", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 9, 0.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24019, 0.0, "2030/12/17 14:59:59", 109102, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, "シズル（バレンタイン）", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 10, 0.0, "2019/01/31 12:00:00", 1, 24, 10011, 0, 24020, 0.0, "2030/12/17 14:59:59", 109102, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "キャル", "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 1, 0.0, "2015/12/17 15:00:00", 1, 26, 0, 0, 26001, 0.0, "2030/12/17 14:59:59", 106001, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "コッコロ", "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 1, 0.0, "2015/12/17 15:00:00", 1, 26, 0, 0, 26002, 0.0, "2030/12/17 14:59:59", 105901, 1);
