INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "コッコロ", "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 1, 0.0, "2015/12/17 15:00:00", 1, 43, 0, 0, 43002, 0.0, "2030/12/17 14:59:59", 105901, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, "キャル", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 1, 0.0, "2015/12/17 15:00:00", 1, 43, 0, 0, 43003, 0.0, "2030/12/17 14:59:59", 106001, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-416.5, "アメス", "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 1, 0.0, "2015/12/17 15:00:00", 1, 44, 0, 0, 43004, 0.0, "2030/12/17 14:59:59", 123001, 1);
