INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-416.5, "アメス", "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 3, 5.79, "2015/12/17 15:00:00", 1, 45, 0, 0, 43006, 0.0, "2030/12/17 14:59:59", 123001, 2);
